import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getUserFavorites, removeFromFavorites } from '../services/propertyService';
import '../profile.css';

const Profile = () => {
    const [user, setUser] = useState(null);
    const [favorites, setFavorites] = useState([]);
    const [properties, setProperties] = useState([]);
    const [rentedProperties, setRentedProperties] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchUserData = async () => {
            const token = sessionStorage.getItem('token');
            if (!token) {
                console.error('No token found');
                return;
            }

            try {
                const response = await fetch('http://localhost:5000/users/me', {
                    method: 'GET',
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });

                if (response.ok) {
                    const data = await response.json();
                    setUser(data);
                } else {
                    const errorData = await response.json();
                    console.error('Error fetching user data:', errorData);
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        const fetchProperties = async () => {
            const token = sessionStorage.getItem('token');
            if (!token) {
                console.error('No token found');
                return;
            }

            try {
                const response = await fetch('http://localhost:5000/properties/user', {
                    method: 'GET',
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });

                if (response.ok) {
                    const data = await response.json();
                    setProperties(data);
                } else {
                    const errorData = await response.json();
                    console.error('Error fetching properties:', errorData);
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        const fetchUserFavorites = async () => {
            const token = sessionStorage.getItem('token');
            if (!token) {
                console.error('No token found');
                return;
            }

            try {
                const favoriteData = await getUserFavorites(token);
                setFavorites(favoriteData);
            } catch (error) {
                console.error('Error fetching user favorites:', error);
            }
        };

        const fetchRentedProperties = async () => {
            const token = sessionStorage.getItem('token');
            if (!token) {
                console.error('No token found');
                return;
            }

            try {
                const response = await fetch('http://localhost:5000/rented-properties', {
                    method: 'GET',
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });

                if (response.ok) {
                    const data = await response.json();
                    setRentedProperties(data);
                } else {
                    const errorData = await response.json();
                    console.error('Error fetching rented properties:', errorData);
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        fetchUserData();
        fetchProperties();
        fetchUserFavorites();
        fetchRentedProperties();
    }, []);

    const handleEdit = (propertyId) => {
        navigate(`/editproperty/${propertyId}`);
    };

    const handleDelete = async (propertyId) => {
        const token = sessionStorage.getItem('token');
        if (!token) {
            console.error('No token found');
            return;
        }

        try {
            const response = await fetch(`http://localhost:5000/properties/${propertyId}`, {
                method: 'DELETE',
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });

            if (response.ok) {
                setProperties(properties.filter(property => property.id !== propertyId));
            } else {
                const errorData = await response.json();
                console.error('Error deleting property:', errorData);
            }
        } catch (error) {
            console.error('Error:', error);
        }
    };

    const handleRemoveFromFavorites = async (propertyId) => {
        const token = sessionStorage.getItem('token');
        if (!token) {
            console.error('No token found');
            return;
        }

        try {
            await removeFromFavorites(propertyId, token);
            setFavorites(favorites.filter(favorite => favorite.Property.id !== propertyId));
        } catch (error) {
            console.error('Error removing from favorites:', error);
        }
    };

    return (
        <div className="profile-container">
            <header className="profile-header">
                <h1>My Properties</h1>
            </header>
            {user ? (
                <div className="user-details-card">
                    <h2>{user.username}</h2>
                    <p>Email: {user.email}</p>
                </div>
            ) : (
                <p>Loading user data...</p>
            )}
            <div className="favorites-section">
                <h2>Favorites</h2>
                {favorites.length === 0 ? (
                    <p>No favorite properties.</p>
                ) : (
                    <ul>
                        {favorites.map((favorite) => (
                            <li key={favorite.Property.id}>
                                <h3>{favorite.Property.title}</h3>
                                <p>{favorite.Property.description}</p>
                                <button onClick={() => handleRemoveFromFavorites(favorite.Property.id)}>Remove from Favorites</button>
                            </li>
                        ))}
                    </ul>
                )}
            </div>
            <div className="properties-section">
                <h2>My Properties</h2>
                {properties.length === 0 ? (
                    <p>No properties found.</p>
                ) : (
                    <ul>
                        {properties.map((property) => (
                            <li key={property.id}>
                                <h3>{property.title}</h3>
                                <p>{property.description}</p>
                                <button onClick={() => handleEdit(property.id)}>Edit</button>
                                <button onClick={() => handleDelete(property.id)}>Delete</button>
                            </li>
                        ))}
                    </ul>
                )}
            </div>
            <div className="rented-properties-section">
                <h2>Rented Properties</h2>
                {rentedProperties.length === 0 ? (
                    <p>No rented properties.</p>
                ) : (
                    <ul>
                        {rentedProperties.map((property) => (
                            <li key={property.id}>
                                <h3>{property.title}</h3>
                                <p>{property.description}</p>
                            </li>
                        ))}
                    </ul>
                )}
            </div>
        </div>
    );
};

export default Profile;
